import React, { useState, useEffect } from "react";
import { APIProvider, Map } from '@vis.gl/react-google-maps';
import { Link } from "react-router-dom";
import logo from "./logo.png"; // Import your logo image

const position = { lat: 6.8214925581511565, lng: 80.04122509763354 };

const Dashboard = () => {
    const [height, setHeight] = useState(0); // Height state

    useEffect(() => {
        const column2 = document.getElementById('column_two');
        if (column2) {
            setHeight(column2.offsetHeight);
        }
    }, []);

    const handleHideBlocks = () => {
        const column1 = document.getElementById("column_one");
        const column2 = document.getElementById("column_two");
        const btn = document.getElementById("HideBtn");

        if (btn.innerHTML === "Hide Blocks") {
            column1.style.display = 'none';
            column2.style.width = '100%';
            btn.innerHTML = "Show Blocks";
        } else {
            column1.style.display = 'inline';
            column2.style.width = '80%';
            btn.innerHTML = "Hide Blocks";
        }
    };

    return (
        <APIProvider apiKey={"YOUR_GOOGLE_MAPS_API_KEY"}>
            <nav className="navbar">
                <div className="logo">
                    <img src={logo} alt="Logo" width="100" height="100" />
                </div>
                <Link to="/Home"><b>Home</b></Link>
                <div className="dropdown">
                    <Link to="#" className="dropbtn"><b>Student</b></Link>
                    <div className="dropdown-content">
                        <Link to="/Login"><b>Sign In</b></Link>
                        <Link to="/SignUp"><b>Sign Up</b></Link>
                    </div>
                </div>
                <div className="dropdown">
                    <Link to="#" className="dropbtn"><b>Landlord</b></Link>
                    <div className="dropdown-content">
                        <Link to="/LandlordLogin"><b>Sign In</b></Link>
                        <Link to="/LandlordSignup"><b>Sign Up</b></Link>
                    </div>
                </div>
                <Link to="/WardenLogin"><b>Warden</b></Link>
                <Link to="/AdminLogin"><b>Admin</b></Link>
                <button className="profile-btn" title="Home">
                    <img src="https://www.wikipedia.org/portal/wikipedia.org/assets/img/Wikipedia-logo-v2.png" className="profile-img" alt="Student logo" />
                    student@gmail.com
                </button>
            </nav>

            <article className="dashboard-content">
                <div className="column-one">
                    <Link className="link" to="/Dashboard">Dashboard</Link>
                    <Link className="link" to="/Profile">Profile</Link>
                    <Link className="link" to="/Reservations">Reservations</Link>
                    <a className="logout-link" href="#0">Log Out</a>
                </div>

                <div className="column-two">
                    <button className="hide-btn" id="HideBtn" onClick={handleHideBlocks}>Hide Blocks</button>

                    <article className="welcome-article">
                        <img src="https://students.nsbm.ac.lk/img/1nsbm.png" className="welcome-img" alt="Welcome" />
                        <h3>Welcome Student</h3>
                        <h2>To NSBM Accommodation Rental Service</h2>
                    </article>

                    <article className="accommodations-article">
                        <h1>Accommodations</h1>
                        <div className="map-container">
                            <Map defaultCenter={position} defaultZoom={12}></Map>
                        </div>
                    </article>
                </div>
            </article>

            <footer className="footer">
                <small className="copyright">© Created by Group CC, All Rights Reserved.</small>
            </footer>
        </APIProvider>
    );
}

export default Dashboard;
